밴쿠버 올 때 우리 가족
짐 중 대부분은 책이었다

많이 처분하고 왔음에도
아이들 책 수준은 계속 올라가고,
거기다 막내둥이까지 태어나면서

거의 전 연령대의 책이 필요하게 되었다

밴쿠버 온 뒤로도
배로 여러차례 책을 받았더니
벽이 책장으로 가득하다

키 순서에 따라
맨 아랫칸은 막내둥이 책
중간은 둘째공주 책
위쪽는 첫째덕후씨 책

이제 책육아 10년차

아이들 나이에 맞춰 그리고 개인성향과 
성별에 맞춰 책 고르는 노하우도생기고,
셀렉한 책 아이들이 잘 읽으면 뿌듯하다

어떻게 하면 아이들이 편안하고, 즐겁고, 
재미있게 독서할지 연구하는 엄마 
(나도 그렇게 책을 읽고 싶으니까)

