Hola! Hoy les traigo un poco de información sobre nuestra queen, por si no conocían 😌
.
Tillie Cole es una autora best seller del USA Today y también una de las más vendidas en grandes cadenas norteamericanas en los géneros de novela romántica, erótica y new adult. De madre inglesa y de padre escocés, Tillie nació en el norte de Inglaterra y creció rodeada de naturaleza, animales rescatados y caballos. A los diecinueve años, se trasladó a Newcastle-Upon-Tyne, donde se licenció en Estudios Religiosos.
Después de haber trabajado durante años como profesora en institutos impartiendo clases de Ciencias sociales, Humanidades e Historia, y después de haber seguido por toda Europa a su marido (jugador profesional de rugby), se han instalado en Calgary, Canadá.
Además de sentir pasión por la escritura, Tillie se considera una amante de las artes escénicas: le encanta el teatro, bailar, actuar y cantar (a veces, incluso, bajo la lluvia).
.
Ha escrito una gran cantidad de libros, sobre todo series que han impactado, entre ellas la serie de Hades Hangmen, Sweet Home, Scarred Souls, Deadly Vitues y Eternally North. También ha escrito libros independientes como ser juvenil A thousand boy kisses, Sick Fux, A wish for us, A veil of vines, y su último libro, Thoroughly Whipped.
Se espera a finales del año o entrado el siguiente su siguiente libro Lord of London Town.
.
